import React, { useState, useEffect } from 'react';
import { SentenceData, Sentence } from './types';
import './styles/App.css';

const App: React.FC = () => {
  const [sentences, setSentences] = useState<Sentence[]>([]);
  const [loading, setLoading] = useState<boolean>(true);
  const [error, setError] = useState<string>('');
  const [showWords, setShowWords] = useState<{ [key: number]: boolean }>({});

  useEffect(() => {
    const loadData = async () => {
      try {
        console.log('Starting to fetch data...');
        const response = await fetch('/data/sentences202508.json');
        console.log('Response:', response);

        if (!response.ok) {
          throw new Error(`HTTP error! status: ${response.status}`);
        }

        const text = await response.text();
        console.log('Raw response:', text.substring(0, 100));

        const data: SentenceData = JSON.parse(text);
        console.log('Parsed data:', data);

        if (data && data.contents && data.contents.sentences) {
          setSentences(data.contents.sentences);
        } else {
          throw new Error('Invalid data structure');
        }
      } catch (err) {
        console.error('Error:', err);
        setError(err instanceof Error ? err.message : 'Unknown error');
      } finally {
        setLoading(false);
      }
    };

    loadData();
  }, []);

  const toggleWords = (sentenceId: number) => {
    setShowWords(prev => ({
      ...prev,
      [sentenceId]: !prev[sentenceId]
    }));
  };

  if (loading) {
    return <div className="app"><div className="loading">Loading...</div></div>;
  }

  if (error) {
    return (
      <div className="app">
        <div className="error">
          <h2>Error</h2>
          <p>{error}</p>
        </div>
      </div>
    );
  }

  return (
    <div className="app">
      <header className="app-header">
        <h1>ì¤‘êµ­ì–´ ë¬¸ìž¥ í•™ìŠµ</h1>
        <div className="date-info">2025ë…„ 08ì›”</div>
      </header>

      <main className="content">
        <div className="sentences-container">
          {sentences.map((sentence) => (
            <div key={sentence.id} className="sentence-card">
              <span className="sentence-number">ë¬¸ìž¥ {sentence.id}</span>
              <div className="chinese-sentence">{sentence.sentence}</div>
              <div className="pinyin">{sentence.pinyin}</div>

              <div className="meanings">
                <div className="meaning-item">
                  <div className="meaning-label">ðŸ‡°ðŸ‡· í•œêµ­ì–´</div>
                  <div className="meaning-text">{sentence['meaning-korean']}</div>
                </div>
                <div className="meaning-item">
                  <div className="meaning-label">ðŸ‡ºðŸ‡¸ English</div>
                  <div className="meaning-text">{sentence['meaning-english']}</div>
                </div>
              </div>

              <div className="words-section">
                <div className="words-toggle" onClick={() => toggleWords(sentence.id)}>
                  <div className="words-title">ðŸ“š ë‹¨ì–´ í•™ìŠµ ({sentence.words.length}ê°œ)</div>
                  <span className={`toggle-arrow ${showWords[sentence.id] ? 'expanded' : ''}`}>
                    â–¼
                  </span>
                </div>
                <div className={`words-content ${showWords[sentence.id] ? 'expanded' : ''}`}>
                  <div className="words-grid">
                    {sentence.words.map((word, index) => (
                      <div key={index} className="word-card">
                        <div className="word-chinese">{word.chinese}</div>
                        <div className="word-pinyin">{word.pinyin}</div>
                        <div className="word-meaning">ðŸ‡°ðŸ‡· {word.korean}</div>
                        <div className="word-meaning">ðŸ‡ºðŸ‡¸ {word.english}</div>
                        <span className="word-type">{word.type}</span>
                      </div>
                    ))}
                  </div>
                </div>
              </div>
            </div>
          ))}
        </div>
      </main>
    </div>
  );
};

export default App;
